// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

import { SafeMath } from "@openzeppelin/contracts/utils/math/SafeMath.sol";

import "./interfaces/IPositionManager.sol";
import "./interfaces/IMarginAccount.sol";
import "./interfaces/IOrderBook.sol";

// size is 10**10
// price is 10**2
contract OrderBook is IOrderBook {
    using SafeMath for uint256;

    struct Order {
        uint256 price;
        uint256 size;
        uint256 acceptableRange;
        address ownerAddress;
    }

    struct PricePoint {
        uint256 totalCompletedOrCanceledOrders;
        uint256 totalOrdersAtPrice; // sum of size of all orders placed at the price point
        uint256 executableSize; // market orders that have been executed and can be claimed by limit order owners
    }

    uint256[] private buyOrdersHeap;
    uint256[] private sellOrdersHeap;

    mapping(uint256 => Order) private orders;
    mapping(uint256 => PricePoint) private buyPricePoints;
    mapping(uint256 => PricePoint) private sellPricePoints;

    uint256 private orderIdCounter;

    address positionManager;
    address marginAccount;
    address tokenAddress;

    /**
     * @dev Constructor.
     * @param _positionManager Address of the PositionManager contract.
     * @param _marginAccount Address of the MarginAccount contract.
     * @param _tokenAddress Address of the token used for trading.
     */
    constructor (address _positionManager, address _marginAccount, address _tokenAddress) {
        marginAccount = _marginAccount;
        positionManager = _positionManager;
        tokenAddress = _tokenAddress;
    }

    /**
     * @dev Adds a buy order to the order book.
     * @param price Price of the buy order.
     * @param size Size of the buy order.
     */
    function addBuyOrder(uint256 price, uint256 size) external {
        orderIdCounter++;

        PricePoint storage _pricePoint = buyPricePoints[price];

        if (_pricePoint.totalOrdersAtPrice == 0) {
            _insertBuyPrice(price);
        }

        _addOrder(_pricePoint, price, size);

        IMarginAccount(marginAccount).lockFunds(msg.sender, tokenAddress);
    }

    /**
     * @dev Adds a sell order to the order book.
     * @param price Price of the sell order.
     * @param size Size of the sell order.
     */
    function addSellOrder(uint256 price, uint256 size) external {
        orderIdCounter++;

        PricePoint storage _pricePoint = sellPricePoints[price];

        if (_pricePoint.totalOrdersAtPrice == 0) {
            _insertSellPrice(price);
        }

        _addOrder(_pricePoint, price, size);

        IMarginAccount(marginAccount).lockFunds(msg.sender, tokenAddress);
    }

    /**
     * @dev Cancels a sell order.
     * @param _orderId ID of the sell order to cancel.
     */
    function cancelSellOrder(uint256 _orderId) external {
        Order storage _order = orders[_orderId];

        require(msg.sender == _order.ownerAddress);

        sellPricePoints[_order.price].totalCompletedOrCanceledOrders += _order.size;

        delete orders[_orderId];

        IMarginAccount(marginAccount).unlockFunds(msg.sender, tokenAddress);
    }

    /**
     * @dev Cancels a buy order.
     * @param _orderId ID of the buy order to cancel.
     */
    function cancelBuyOrder(uint256 _orderId) external {
        Order storage _order = orders[_orderId];

        require(msg.sender == _order.ownerAddress);

        buyPricePoints[_order.price].totalCompletedOrCanceledOrders += _order.size;

        delete orders[_orderId];

        IMarginAccount(marginAccount).unlockFunds(msg.sender, tokenAddress);
    }

    /**
     * @dev Internal function to add an order to the order book.
     * @param _pricePoint PricePoint storage object for the order's price point.
     * @param _price Price of the order.
     * @param _size Size of the order.
     */
    function _addOrder(PricePoint storage _pricePoint, uint256 _price, uint256 _size) internal {
        uint256 acceptableRange = (_pricePoint.totalOrdersAtPrice == 0)
            ? 0
            : _pricePoint.totalOrdersAtPrice;

        orders[orderIdCounter] = Order(_price, _size, acceptableRange, msg.sender);

        _pricePoint.totalOrdersAtPrice += _size;
    }

    /**
     * @dev Places and executes a market buy order.
     * @param _size Size of the market buy order.
     */
    function placeAndExecuteMarketBuy(uint256 _size) external {
        require(_size > 0);

        PricePoint storage _pricePoint = sellPricePoints[sellOrdersHeap[0]];
        uint256 _volumeAtPricePoint = _pricePoint.totalOrdersAtPrice - _pricePoint.totalCompletedOrCanceledOrders - _pricePoint.executableSize;
        uint256 _priceToPay = 0;

        while (_size > _volumeAtPricePoint) {
            _priceToPay += _volumeAtPricePoint.mul(sellOrdersHeap[0]);
            _pricePoint.executableSize += _volumeAtPricePoint;
            _size -= _volumeAtPricePoint;
            _popSellOrderHeap();

            _pricePoint = sellPricePoints[sellOrdersHeap[0]];
            _volumeAtPricePoint = _pricePoint.totalOrdersAtPrice - _pricePoint.totalCompletedOrCanceledOrders - _pricePoint.executableSize;
        }

        if (_size > 0) {
            _priceToPay += _size.mul(sellOrdersHeap[0]);
            _pricePoint.executableSize += _size;
        }

        IPositionManager(positionManager).increasePosition(msg.sender, tokenAddress, _size, _priceToPay);
    }

    /**
     * @dev Places and executes a market sell order.
     * @param _size Size of the market sell order.
     */
    function placeAndExecuteMarketSell(uint256 _size) external {
        require(_size > 0);

        PricePoint storage _pricePoint = buyPricePoints[buyOrdersHeap[0]];
        uint256 _volumeAtPricePoint = _pricePoint.totalOrdersAtPrice - _pricePoint.totalCompletedOrCanceledOrders - _pricePoint.executableSize;
        uint256 _priceToPay = 0;

        while (_size > _volumeAtPricePoint) {
            _priceToPay += _volumeAtPricePoint.mul(sellOrdersHeap[0]);
            _pricePoint.executableSize += _volumeAtPricePoint;
            _size -= _volumeAtPricePoint;
            _popBuyOrderHeap();


            _pricePoint = buyPricePoints[buyOrdersHeap[0]];
            _volumeAtPricePoint = _pricePoint.totalOrdersAtPrice - _pricePoint.totalCompletedOrCanceledOrders - _pricePoint.executableSize;
        }

        if (_size > 0) {
            _priceToPay += _size.mul(sellOrdersHeap[0]);
            _pricePoint.executableSize += _size;
        }

        IPositionManager(positionManager).decreasePosition(msg.sender, tokenAddress, _size, _priceToPay);
    }

    /**
     * @dev Claims a sell limit order.
     * @param _orderId ID of the sell limit order to claim.
     */
    function claimSellLimitOrder(uint256 _orderId) external {
        Order storage _order = orders[_orderId];
        require(msg.sender == _order.ownerAddress);

        PricePoint storage _pricePoint = sellPricePoints[_order.price];
        require(_order.acceptableRange < _pricePoint.executableSize + _pricePoint.totalCompletedOrCanceledOrders);

        uint256 _executableSize = _pricePoint.executableSize + _pricePoint.totalCompletedOrCanceledOrders - _order.acceptableRange;

        uint256 _sizeToExecute = _executableSize > _order.size
            ? _order.size
            : _executableSize;

        _order.size -= _sizeToExecute;
        _pricePoint.totalCompletedOrCanceledOrders += _sizeToExecute;
        _pricePoint.executableSize -= _sizeToExecute;

        IPositionManager(positionManager).decreasePosition(msg.sender, tokenAddress, _sizeToExecute, _sizeToExecute.mul(_order.price));

        if (_order.size == 0) {
            delete orders[_orderId];
            IMarginAccount(marginAccount).unlockFunds(msg.sender, tokenAddress);
        }
    }

    /**
     * @dev Claims a buy limit order.
     * @param _orderId ID of the buy limit order to claim.
     */
    function claimBuyLimitOrder(uint256 _orderId) external {
        Order storage _order = orders[_orderId];
        require(msg.sender == _order.ownerAddress);

        PricePoint storage _pricePoint = buyPricePoints[_order.price];
        require(_order.acceptableRange < _pricePoint.executableSize + _pricePoint.totalCompletedOrCanceledOrders);

        uint256 _executableSize = _pricePoint.executableSize + _pricePoint.totalCompletedOrCanceledOrders - _order.acceptableRange;

        uint256 _sizeToExecute = _executableSize > _order.size
            ? _order.size
            : _executableSize;

        _order.size -= _sizeToExecute;
        _pricePoint.totalCompletedOrCanceledOrders += _sizeToExecute;
        _pricePoint.executableSize -= _sizeToExecute;

        IPositionManager(positionManager).increasePosition(msg.sender, tokenAddress, _sizeToExecute, _sizeToExecute.mul(_order.price));

        if (_order.size == 0) {
            delete orders[_orderId];
            IMarginAccount(marginAccount).unlockFunds(msg.sender, tokenAddress);
        }
    }

    /**
     * @dev Internal function to insert a buy price into the buy orders heap.
     * @param price Price to insert.
     */
    function _insertBuyPrice(uint256 price) private {
        uint256 idx = buyOrdersHeap.length;
        buyOrdersHeap.push(price);

        while (idx > 0) {
            uint256 parentIdx = (idx - 1) / 2;
            if (buyOrdersHeap[parentIdx] >= buyOrdersHeap[idx]) {
                break;
            }
            (buyOrdersHeap[idx], buyOrdersHeap[parentIdx]) = (
                buyOrdersHeap[parentIdx],
                buyOrdersHeap[idx]
            );
            idx = parentIdx;
        }
    }

    /**
     * @dev Internal function to insert a sell price into the sell orders heap.
     * @param price Price to insert.
     */
    function _insertSellPrice(uint256 price) private {
        uint256 idx = sellOrdersHeap.length;
        sellOrdersHeap.push(price);

        while (idx > 0) {
            uint256 parentIdx = (idx - 1) / 2;
            if (sellOrdersHeap[parentIdx] <= sellOrdersHeap[idx]) {
                break;
            }
            (sellOrdersHeap[idx], sellOrdersHeap[parentIdx]) = (
                sellOrdersHeap[parentIdx],
                sellOrdersHeap[idx]
            );
            idx = parentIdx;
        }
    }

    /**
     * @dev Internal function to remove the top buy order from the buy orders heap.
     */
    function _popBuyOrderHeap() private {
        require(buyOrdersHeap.length >= 1, "No buy orders available");

        uint256 lastElementIndex = buyOrdersHeap.length - 1;
        buyOrdersHeap[0] = buyOrdersHeap[lastElementIndex];
        buyOrdersHeap.pop();

        _heapifyBuyOrders(0);
    }

    /**
     * @dev Internal function to remove the top sell order from the sell orders heap.
     */
    function _popSellOrderHeap() private {
        require(sellOrdersHeap.length > 1, "No sell orders available");

        uint256 lastElementIndex = sellOrdersHeap.length - 1;
        sellOrdersHeap[0] = sellOrdersHeap[lastElementIndex];
        sellOrdersHeap.pop();

        _heapifySellOrders(0);
    }

    /**
     * @dev Internal function to heapify the buy orders heap.
     * @param index Index to start heapifying from.
     */
    function _heapifyBuyOrders(uint256 index) private {
        uint256 leftChild = index * 2 + 1;
        uint256 rightChild = leftChild + 2;
        uint256 largest = index;

        if (leftChild < buyOrdersHeap.length && buyOrdersHeap[leftChild] > buyOrdersHeap[largest]) {
            largest = leftChild;
        }

        if (rightChild < buyOrdersHeap.length && buyOrdersHeap[rightChild] > buyOrdersHeap[largest]) {
            largest = rightChild;
        }

        if (largest != index) {
            (buyOrdersHeap[index], buyOrdersHeap[largest]) = (buyOrdersHeap[largest], buyOrdersHeap[index]);
            _heapifyBuyOrders(largest);
        }
    }

    /**
     * @dev Internal function to heapify the sell orders heap.
     * @param index Index to start heapifying from.
     */
    function _heapifySellOrders(uint256 index) private {
        uint256 leftChild = index * 2 + 1;
        uint256 rightChild = leftChild + 2;
        uint256 smallest = index;

        if (leftChild < sellOrdersHeap.length && sellOrdersHeap[leftChild] < sellOrdersHeap[smallest]) {
            smallest = leftChild;
        }

        if (rightChild < sellOrdersHeap.length && sellOrdersHeap[rightChild] < sellOrdersHeap[smallest]) {
            smallest = rightChild;
        }

        if (smallest != index) {
            (sellOrdersHeap[index], sellOrdersHeap[smallest]) = (sellOrdersHeap[smallest], sellOrdersHeap[index]);
            _heapifySellOrders(smallest);
        }
    }

    /**
     * @dev Returns the current price points in the order book.
     * @return The lowest sell price and the highest buy price.
     */
    function pricePoints() external override view returns (uint256, uint256) {
        return (sellOrdersHeap[0], buyOrdersHeap[0]);
    }
}

